         if ($aP['CS'] \u003e 0 \u0026\u0026 (self::strlen($vZ) !== (int)$aP['CS'])) { // check only if availabled","                $aI['E'] = 1;","                $aI['EM'] = 'Compressed size is not equal with the value in header information.';","            }","//          } elseif ( $bE ) {","//              $aI['E']  = 5;","//              $aI['EM'] = 'File is encrypted, which is not supported from this class.';","/*            } else {","                switch ($aP['CM']) {","                    case 0: // Stored","                        // Here is nothing to do, the file ist flat.","                        break;","                    case 8: // Deflated","                        $vZ = gzinflate($vZ);","                        break;","                    case 12: // BZIP2","                        if (extension_loaded('bz2')) {","                            $vZ = bzdecompress($vZ);","                        } else {","                            $aI['E'] = 7;","                            $aI['EM'] = 'PHP BZIP2 extension not available.';","                        }","                        break;","                    default:","                        $aI['E'] = 6;","                        $aI['EM'] = \"De-/Compression method {$aP['CM']} is not supported.\";","                }","                if (!$aI['E']) {","                    if ($vZ === false) {","                        $aI['E'] = 2;","                        $aI['EM'] = 'Decompression of data failed.';","                    } elseif ($this-\u003e_strlen($vZ) !== (int)$aP['UCS']) {","                        $aI['E'] = 3;","                        $aI['EM'] = 'Uncompressed size is not equal with the value in header information.';","                    } elseif (crc32($vZ) !== $aP['CRC']) {","                        $aI['E'] = 4;","                        $aI['EM'] = 'CRC32 checksum is not equal with the value in header information.';","                    }","                }","            }","