           }","                        }","                    }","","                    break;","                }","            }","        }","","//        $m2 = memory_get_peak_usage(true);","//        echo __FUNCTION__.' M='.round( ($m2-$m1) / 1048576, 2).'MB'.PHP_EOL;","","        if (count($this-\u003esheets)) {","            // Sort sheets","            ksort($this-\u003esheets);","","            return true;","        }","","        return false;","    }","","    public function getEntryXML($name)","    {","        if ($entry_xml = $this-\u003egetEntryData($name)) {","            $this-\u003edeleteEntry($name); // economy memory","            // dirty remove namespace prefixes and empty rows","            $entry_xml = preg_replace('/xmlns[^=]*=\"[^\"]*\"/i', '', $entry_xml); // remove namespaces","            $entry_xml .= ' '; // force run garbage collector","            // remove namespaced attrs","            $entry_xml = preg_replace('/[a-zA-Z0-9]+:([a-zA-Z0-9]+=\"[^\"]+\")/', '$1', $entry_xml);","            $entry_xml .= ' ';","            $entry_xml = preg_replace('/\u003c[a-zA-Z0-9]+:([^\u003e]+)\u003e/', '\u003c$1\u003e', $entry_xml); // fix namespaced openned tags","            $entry_xml .= ' ';","            $entry_xml = preg_replace('/\u003c\\/[a-zA-Z0-9]+:([^\u003e]+)\u003e/', '\u003c/$1\u003e', $entry_xml); // fix namespaced closed tags","            $entry_xml .= ' ';","","            if (strpos($name, '/sheet')) { // dirty skip empty rows","                // remove \u003crow...\u003e \u003cc /\u003e\u003cc /\u003e\u003c/row\u003e","                $entry_xml = preg_replace('/\u003crow[^\u003e]+\u003e\\s*(\u003cc[^\\/]+\\/\u003e\\s*)+\u003c\\/row\u003e/', '', $entry_xml, -1, $cnt);","                $entry_xml .= ' ';","                // remove \u003crow /\u003e","                $entry_xml = preg_replace('/\u003crow[^\\/\u003e]*\\/\u003e/', '', $entry_xml, -1, $cnt2);","                $entry_xml .= ' ';","                // remove \u003